import React from "react";
import Header from "../components/Header.jsx";
import Footer from "../components/Footer.jsx";
function AboutUs(){
    return (
        <div>
            <Header />
            <div>
                <h1>About Us</h1>
            </div>
            <Footer />
        </div>
    )
}
export default AboutUs;
